import React from "react";
import "../style.scss";

const Login = () => {
  return <div className="auth">
    <h1>Login</h1>
    <form action="">
      <input type="text" name="" id="" placeholder="username" />
      <input type="password" name="" id="" placeholder="password" />
      <button type="submit">Login</button>
    </form>
  </div>;
};

export default Login;
